#if BABEL
        //
        //  Get the next token for Visual Studio
        //
        //  "state" is the inout mode variable that maintains scanner
        //  state between calls, using the EolState property. In principle,
        //  if the calls of EolState are costly set could be called once
        //  only per line, at the start; and get called only at the end
        //  of the line. This needs more infrastructure ...
        //
        public int GetNext(ref int state, out int start, out int end)
        {
                Token next;
            int s, e;
            s = state;        // state at start
            EolState = state;
                next = (Token)Scan();
            state = EolState;
            e = state;       // state at end;
            start = tokPos;
            end = tokEPos - 1; // end is the index of last char.
            return (int)next;
        }        
#endif // BABEL

        // ======== AbstractScanner<> Implementation =========

        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        [SuppressMessage("Microsoft.Naming", "CA1709:IdentifiersShouldBeCasedCorrectly", MessageId = "yylex")]
        [SuppressMessage("Microsoft.Naming", "CA1704:IdentifiersShouldBeSpelledCorrectly", MessageId = "yylex")]
        public override int yylex()
        {
            // parserMax is set by reflecting on the Tokens
            // enumeration.  If maxParseToken is defined
            // that is used, otherwise int.MaxValue is used.
            int next;
            do { next = Scan(); } while (next >= parserMax);
            return next;
        }
        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        int yypos { get { return tokPos; } }
        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        int yyline { get { return tokLin; } }
        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        int yycol { get { return tokCol; } }

        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        [SuppressMessage("Microsoft.Naming", "CA1709:IdentifiersShouldBeCasedCorrectly", MessageId = "yytext")]
        [SuppressMessage("Microsoft.Naming", "CA1704:IdentifiersShouldBeSpelledCorrectly", MessageId = "yytext")]
        public string yytext
        {
            get 
            {
                if (tokTxt == null) 
                    tokTxt = buffer.GetString(tokPos, tokEPos);
                return tokTxt;
            }
        }

        /// <summary>
        /// Discards all but the first "n" codepoints in the recognized pattern.
        /// Resets the buffer position so that only n codepoints have been consumed;
        /// yytext is also re-evaluated. 
        /// </summary>
        /// <param name="n">The number of codepoints to consume</param>
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        void yyless(int n)
        {
            buffer.Pos = tokPos;
            // Must read at least one char, so set before start.
            cCol = tokCol - 1; 
            GetCode();
            // Now ensure that line counting is correct.
            lNum = tokLin;
            // And count the rest of the text.
            for (int i = 0; i < n; i++) GetCode();
            MarkEnd();
        }
       
        //
        //  It would be nice to count backward in the text
        //  but it does not seem possible to re-establish
        //  the correct column counts except by going forward.
        //
        /// <summary>
        /// Removes the last "n" code points from the pattern.
        /// </summary>
        /// <param name="n">The number to remove</param>
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        void _yytrunc(int n) { yyless(yyleng - n); }
        
        //
        // This is painful, but we no longer count
        // codepoints.  For the overwhelming majority 
        // of cases the single line code is fast, for
        // the others, well, at least it is all in the
        // buffer so no files are touched. Note that we
        // can't use (tokEPos - tokPos) because of the
        // possibility of surrogate pairs in the token.
        //
        /// <summary>
        /// The length of the pattern in codepoints (not the same as 
        /// string-length if the pattern contains any surrogate pairs).
        /// </summary>
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        [SuppressMessage("Microsoft.Naming", "CA1709:IdentifiersShouldBeCasedCorrectly", MessageId = "yyleng")]
        [SuppressMessage("Microsoft.Naming", "CA1704:IdentifiersShouldBeSpelledCorrectly", MessageId = "yyleng")]
        public int yyleng
        {
            get {
                if (tokELin == tokLin)
                    return tokECol - tokCol;
                else
#if BYTEMODE
                    return tokEPos - tokPos;
#else
                {
                    int ch;
                    int count = 0;
                    int save = buffer.Pos;
                    buffer.Pos = tokPos;
                    do {
                        ch = buffer.Read();
                        if (!char.IsHighSurrogate((char)ch)) count++;
                    } while (buffer.Pos < tokEPos && ch != ScanBuff.EndOfFile);
                    buffer.Pos = save;
                    return count;
                }
#endif // BYTEMODE
            }
        }
        
        // ============ methods available in actions ==============

        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal int YY_START {
            get { return currentScOrd; }
            set { currentScOrd = value; 
                  currentStart = startState[value]; 
            } 
        }
        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal void BEGIN(int next) {
            currentScOrd = next;
            currentStart = startState[next];
        }

        // ============== The main tokenizer code =================

        int Scan() {
                for (; ; ) {
                    int next;              // next state to enter
#if LEFTANCHORS
                    for (;;) {
                        // Discard characters that do not start any pattern.
                        // Must check the left anchor condition after *every* GetCode!
                        state = ((cCol == 0) ? anchorState[currentScOrd] : currentStart);
                        if ((next = NextState()) != goStart) break; // LOOP EXIT HERE...
                        GetCode();
                    }
                    
#else // !LEFTANCHORS
                    state = currentStart;
                    while ((next = NextState()) == goStart) {
                        // At this point, the current character has no
                        // transition from the current state.  We discard 
                        // the "no-match" char.   In traditional LEX such 
                        // characters are echoed to the console.
                        GetCode();
                    }
#endif // LEFTANCHORS                    
                    // At last, a valid transition ...    
                    MarkToken();
                    state = next;
                    GetCode();                    
#if BACKUP
                    bool contextSaved = false;
                    while ((next = NextState()) > eofNum) { // Exit for goStart AND for eofNum
                        if (state <= maxAccept && next > maxAccept) { // need to prepare backup data
                            // Store data for the *latest* accept state that was found.
                            SaveStateAndPos( ref ctx );
                            contextSaved = true;
                        }
                        state = next;
                        GetCode();
                    }
                    if (state > maxAccept && contextSaved)
                        RestoreStateAndPos( ref ctx );
#else  // BACKUP
                    while ((next = NextState()) > eofNum) { // Exit for goStart AND for eofNum
                         state = next;
                         GetCode();
                    }
#endif // BACKUP
                    if (state <= maxAccept) {
                        MarkEnd();
#region ActionSwitch
#pragma warning disable 162, 1522
    switch (state)
    {
        case eofNum:
            switch (currentStart) {
                case 73:
/*This is needed for yywrap to work, do not delete this comment!!!*/
                    break;
            }
            if (yywrap())
                return (int)Token.EOF;
            break;
        case 1: // Recognized '{UnquotedTerm}',	Shortest string "\x01"
        case 4: // Recognized '{UnquotedTerm}',	Shortest string "&"
        case 12: // Recognized '{UnquotedTerm}',	Shortest string "@"
        case 13: // Recognized '{UnquotedTerm}',	Shortest string "A"
        case 14: // Recognized '{UnquotedTerm}',	Shortest string "D"
        case 15: // Recognized '{UnquotedTerm}',	Shortest string "I"
        case 16: // Recognized '{UnquotedTerm}',	Shortest string "N"
        case 17: // Recognized '{UnquotedTerm}',	Shortest string "O"
        case 18: // Recognized '{UnquotedTerm}',	Shortest string "T"
        case 23: // Recognized '{UnquotedTerm}',	Shortest string "|"
        case 30: // Recognized '{UnquotedTerm}',	Shortest string "NO"
        case 32: // Recognized '{UnquotedTerm}',	Shortest string "IN"
        case 33: // Recognized '{UnquotedTerm}',	Shortest string "Ix"
        case 35: // Recognized '{UnquotedTerm}',	Shortest string "INT"
        case 36: // Recognized '{UnquotedTerm}',	Shortest string "INTE"
        case 37: // Recognized '{UnquotedTerm}',	Shortest string "INTER"
        case 38: // Recognized '{UnquotedTerm}',	Shortest string "INTERS"
        case 39: // Recognized '{UnquotedTerm}',	Shortest string "INTERSE"
        case 40: // Recognized '{UnquotedTerm}',	Shortest string "INTERSEC"
        case 42: // Recognized '{UnquotedTerm}',	Shortest string "Dx"
        case 43: // Recognized '{UnquotedTerm}',	Shortest string "Dx0"
        case 44: // Recognized '{UnquotedTerm}',	Shortest string "Dx0."
        case 46: // Recognized '{UnquotedTerm}',	Shortest string "AN"
        case 48: // Recognized '{UnquotedTerm}',	Shortest string "@\x01"
        case 49: // Recognized '{UnquotedTerm}',	Shortest string "@\x01<"
        case 50: // Recognized '{UnquotedTerm}',	Shortest string "@\x01<\x01"
        case 53: // Recognized '{UnquotedTerm}',	Shortest string "0."
        case 57: // Recognized '{UnquotedTerm}',	Shortest string "0000-"
        case 59: // Recognized '{UnquotedTerm}',	Shortest string "0000-0"
        case 60: // Recognized '{UnquotedTerm}',	Shortest string "0000-00"
        case 61: // Recognized '{UnquotedTerm}',	Shortest string "0000-00-"
        case 62: // Recognized '{UnquotedTerm}',	Shortest string "0000-00-0"
        case 63: // Recognized '{UnquotedTerm}',	Shortest string "0000-00-00"
        case 64: // Recognized '{UnquotedTerm}',	Shortest string "0000-00-00T"
        case 65: // Recognized '{UnquotedTerm}',	Shortest string "0000-00-00T0"
        case 66: // Recognized '{UnquotedTerm}',	Shortest string "0000-00-00T00"
if(InMethod && bStack.Count == 0) 
					{
						yylval.s = HandleTermInMethod();
					}
					else 
					{
						yylval.s = yytext;
					}
					return (int)Token.UNQUOTED_TERM;
            break;
        case 2: // Recognized '{Whitespace}',	Shortest string "\t"
/* skip */
            break;
        case 3: // Recognized '"\""',	Shortest string "\""
return (int)Token.QUOTE;
            break;
        case 5: // Recognized '"("',	Shortest string "("
return (int)Token.OPEN_PAREN;
            break;
        case 6: // Recognized '")"',	Shortest string ")"
return (int)Token.CLOSE_PAREN;
            break;
        case 7: // Recognized '"+"',	Shortest string "+"
return (int)Token.PLUS;
            break;
        case 8: // Recognized '","',	Shortest string ","
return (int)Token.COMMA;
            break;
        case 9: // Recognized '"-"',	Shortest string "-"
return (int)Token.MINUS;
            break;
        case 10: // Recognized '{Number}',	Shortest string "0"
        case 54: // Recognized '{Number}',	Shortest string "00"
        case 55: // Recognized '{Number}',	Shortest string "000"
        case 56: // Recognized '{Number}',	Shortest string "0000"
        case 58: // Recognized '{Number}',	Shortest string "00000"
yylval.s = yytext; return (int)Token.INT_NUMBER;
            break;
        case 11: // Recognized '":"',	Shortest string ":"
return (int)Token.COLON;
            break;
        case 19: // Recognized '"["',	Shortest string "["
return (int)Token.OPEN_SQUARE_BRACKET;
            break;
        case 20: // Recognized '"]"',	Shortest string "]"
return (int)Token.CLOSE_SQUARE_BRACKET;
            break;
        case 21: // Recognized '"^"',	Shortest string "^"
return (int)Token.BOOST;
            break;
        case 22: // Recognized '"{"',	Shortest string "{"
return (int)Token.OPEN_CURLY_BRACKET;
            break;
        case 24: // Recognized '"}"',	Shortest string "}"
return (int)Token.CLOSE_CURLY_BRACKET;
            break;
        case 25: // Recognized '"~"',	Shortest string "~"
return (int)Token.TILDA;
            break;
        case 26: // Recognized '"||"',	Shortest string "||"
return (int)Token.OR;
            break;
        case 27: // Recognized '{UnanalizedTerm}',	Shortest string "[[]]"
yylval.s = yytext; return (int)Token.UNANALIZED_TERM;
            break;
        case 28: // Recognized '"TO"',	Shortest string "TO"
return (int)Token.TO;
            break;
        case 29: // Recognized '"OR"',	Shortest string "OR"
return (int)Token.OR;
            break;
        case 31: // Recognized '"NOT"',	Shortest string "NOT"
return (int)Token.NOT;
            break;
        case 34: // Recognized '"Ix"{Number}',	Shortest string "Ix0"
yylval.s = yytext.Substring(2); return (int)Token.INT_NUMBER;
            break;
        case 41: // Recognized '"INTERSECT"',	Shortest string "INTERSECT"
return (int)Token.INTERSECT;
            break;
        case 45: // Recognized '"Dx"{Decimal}',	Shortest string "Dx0.0"
yylval.s = yytext.Substring(2); return (int)Token.FLOAT_NUMBER;
            break;
        case 47: // Recognized '"AND"',	Shortest string "AND"
return (int)Token.AND;
            break;
        case 51: // Recognized '{Method}',	Shortest string "@\x01<\x01>"
        case 52: // Recognized '{Method}',	Shortest string "@\x01<\t>"
yylval.s = yytext; return (int)Token.METHOD;
            break;
        case 67: // Recognized '{DateTime}',	Shortest string "0000-00-00T00:00:00.0000000"
        case 68: // Recognized '{DateTime}',	Shortest string "0000-00-00T00:00:00.0000000Z"
yylval.s = yytext; return (int)Token.DATETIME;
            break;
        case 69: // Recognized '{Decimal}',	Shortest string "0.0"
yylval.s = yytext; return (int)Token.FLOAT_NUMBER;
            break;
        case 70: // Recognized '"&&"',	Shortest string "&&"
return (int)Token.AND;
            break;
        case 71: // Recognized '{QuotedTerm}',	Shortest string "\"\""
yylval.s = yytext; return (int)Token.QUOTED_TERM;
            break;
        case 72: // Recognized '{Comment}',	Shortest string "\t//"
/* skip */
            break;
        default:
            break;
    }
#pragma warning restore 162, 1522
#endregion
                    }
                }
        }

#if BACKUP
        void SaveStateAndPos(ref Context ctx) {
            ctx.bPos  = buffer.Pos;
            ctx.rPos  = readPos;
            ctx.cCol  = cCol;
            ctx.lNum  = lNum;
            ctx.state = state;
            ctx.cChr  = code;
        }

        void RestoreStateAndPos(ref Context ctx) {
            buffer.Pos = ctx.bPos;
            readPos = ctx.rPos;
            cCol  = ctx.cCol;
            lNum  = ctx.lNum;
            state = ctx.state;
            code  = ctx.cChr;
        }
#endif  // BACKUP

        // ============= End of the tokenizer code ================

#if STACK        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal void yy_clear_stack() { scStack.Clear(); }
        
        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal int yy_top_state() { return scStack.Peek(); }
        
        internal void yy_push_state(int state)
        {
            scStack.Push(currentScOrd);
            BEGIN(state);
        }
        
        internal void yy_pop_state()
        {
            // Protect against input errors that pop too far ...
            if (scStack.Count > 0) {
				int newSc = scStack.Pop();
				BEGIN(newSc);
            } // Otherwise leave stack unchanged.
        }
 #endif // STACK

        [SuppressMessage("Microsoft.Performance", "CA1811:AvoidUncalledPrivateCode")]
        internal void ECHO() { Console.Out.Write(yytext); }
        
